import styled from 'styled-components';
import ImgBg from '../../images/cfp-cover-1.jpg';


export const HeroContainer = styled.div`
  background: linear-gradient(
    to right, 
    rgba(0,0,0,0.7), 
    rgba(0,0,0,0.1)), 
    url() (${ImgBg});
`;
